import React from 'react';
import { Link  } from '@reach/router'


const Topics = () => {
  return (
    <section>
      <label>
        <Link to ="/topics/coding">Coding</Link>
      <Link to ="/topics/football">Football</Link>
      <Link to ="/topics/cooking">Cooking</Link>
      </label>

    </section>
  );
};

export default Topics;
